      _feature = [];
      json['feature'].forEach((v) {
        _feature?.add(Feature.fromJson(v));
      });
    }
    if (json['banner'] != null) {
      _banner = [];
      json['banner'].forEach((v) {
        _banner?.add(Banner.fromJson(v));
      });
    }
  }
